import './Footer.css'
function Footer() {
    return (
        <div className='footer-site'>
            <div>
                <h2>WORK EXPERIENCE:</h2>
                <p><span>I have experience with <br/> the specified technologies, <br/> technologies posted on git.</span>
                </p>
                <h2>PERSONAL QUALITIES:</h2>
                <span>Stress resistance, responsibility, positive and creative thinking.</span>
            </div>
        </div>
    );
}
export default Footer;
